sys_variable_value.value:
(function execute(inputs, outputs) {

  // NOTE: The instance_url from inputs is no longer being used in this script. See: DEF0187977
  // We will use the PipelineService to retrieve the prod url instead

  var aesUtils = new AesUtils();

  var prodUrl = '';

  try {
    var pipelineService = new PipelineService();
    prodUrl = pipelineService.getEnvironmentUrl(PipelineConstants.PROD_ENV_COLUMN);
  } catch(error) {
    outputs['has_error'] = true;
    outputs['error_message'] = error.name;
    outputs['status_code'] = error.code;
    return;
  }

  var output = aesUtils.getDataFromInstance(prodUrl, inputs.path, inputs.credential_sys_id, JSON.parse(inputs.stringified_query_params_object || '{}'));

  outputs['body'] = output.body;
  outputs['has_error'] = output.hasError;
  outputs['error_message'] = output.errorMessage;
  outputs['status_code'] = output.statusCode === 0 ? '404' : output.statusCode;

})(inputs, outputs);

